import React, { useContext } from "react";
import './cartitems.css';
import { Shopcontext } from "../../context/shopcontext";
const Cartiems=()=>{
    const {all_product,cartiem,removefromcart}=useContext(Shopcontext);
    return(
        <div className="cartitems">
            <div className="cartitemmen">
                <p>Products</p>
                <p>Title</p>
                <p>Price</p>
                <p>Qty</p>
                <p>Total</p>
                <p>Remove</p>
            </div>
            <hr/>
            <div>
                <div className="cartitemsformat">
                    <img src="" alt="" className="carticon" />
                    <p></p>
                    <p></p>
                    <button className="cartitemsqty"></button>
                    <p></p>
                </div>
            </div>
        </div>
    )
}

export default Cartiems;
